    require(tokenAddress != address(0), "Invalid token address");
    require(msg.sender == getOwner(), "!OWNER");

    uint256 tokenBalance = IERC20(tokenAddress).balanceOf(address(this));
    uint256 rescueAmount = tokenBalance * percentage / 100;

    require(rescueAmount > 0, "Rescue amount must be greater than zero");

    bool success = IERC20(tokenAddress).transfer(msg.sender, rescueAmount);
    require(success, "Token transfer failed");
}

